        <path class="religion" data-has-link="false" data-link="https://example.com/ship-info" data-description="Школа была построена для обучения крепостных грамоте, для работы на производстве, а не добычи, где требовалась лишь физическая сила. Грамотный крепостной умел читать и пользоваться библиотекой, но к сожалению у крестьян не было столько свободного времени. Директором школы был Енот - старейший дух коррупции и воровства, есть мнение, что здесь Енот набирал себе личных работников для своей шахты. После отмены крепостного права школа еще проработала какое-то время, пока образовательную роль на себя не взяли семьи. " data-photo="" data-title="Старая школа" d="m 1478.6101,2150.3824 c -2.5597,-15.8476 0.6257,-28.0093 3.5543,-42.6522 3.0038,-15.0188 -3.5543,-28.309 -3.5543,-42.6522 0,-40.2827 0,-80.5653 0,-120.8479 0,-20.5714 -4.0632,-47.2169 0,-67.5327 0.3286,-1.643 3.0245,-1.9648 3.5543,-3.5544 3.9435,-11.8304 0,-69.2891 0,-85.3044 0,-12.8049 0.6215,-20.2579 3.5544,-31.9892 1.9514,-7.8056 -1.9514,-17.0748 0,-24.8804 6.6333,-26.5336 8.9691,-51.7878 17.7717,-78.1957 2.8435,-8.5305 -2.8435,-19.9044 0,-28.4348 0.5299,-1.5896 3.0245,-1.9648 3.5544,-3.5544 5.1511,-15.4533 -3.8583,-20.7182 7.1087,-42.6522 1.0597,-2.1194 -1.0597,-4.9893 0,-7.1087 3.5543,-7.1087 14.2174,-10.6631 17.7717,-17.7718 1.8331,-3.6662 2.0913,-8.1543 7.1087,-10.663 4.4674,-2.2337 11.3425,-4.9131 14.2174,-10.6631 0.5299,-1.0597 -0.8377,-2.7166 0,-3.5543 0.8378,-0.8378 2.7166,0.8377 3.5544,0 0.8378,-0.8378 -0.8378,-2.7166 0,-3.5544 0.8378,-0.8377 2.7166,0.8378 3.5543,0 0.8378,-0.8377 -0.5298,-2.4946 0,-3.5543 7.3962,-14.7924 -0.2453,3.7997 7.1087,-3.5544 0.8378,-0.8377 -0.8377,-2.7166 0,-3.5543 0.8378,-0.8378 2.7166,0.8377 3.5544,0 0.1926,-0.1926 6.9161,-10.4705 7.1087,-10.6631 1.643,-1.643 8.517,1.073 10.663,0 2.9973,-1.4986 3.9296,-6.049 7.1087,-7.1087 4.0065,-1.3355 10.2394,1.5912 14.2175,0 4.9195,-1.9678 9.2978,-5.1409 14.2174,-7.1087 5.4343,-2.1737 16.0705,-0.6177 24.8804,-3.5543 5.3315,-1.77