        <path class="religion" data-has-link="false" data-link="" data-title="Дом Бообы" data-photo="" data-description="Многие скажут, что многие неудачи и невезенья убили этот дом, но это не так, как Буба первый и единственный член этого дома отверг оценочные суждения, так он и отрек активные действия. Буба не умер, как и его дом, он стал невидемым наблюдателем, который лишь изредка вмешивается в дела мирские отдавая управление в руки других. Сам дом зародился из зерна, а зерно из кармана Бубы, некоторые слухи поговаривают, что все зерно произошло просто из-за неудачи Бубы, который уронил его в землю, потом притоптал когда на него напал карась, а позже полил на это место бочку с водой, которая невиданным образом сломалась в районе всей бочки оставив только одну палочку." d="m 4936.4968,1079.0778 c -17.8435,-9.1493 -34.6028,-23.7707 -43.1631,-40.8914 -3.616,-7.2319 3.616,-26.8442 0,-34.0761 -2.6412,-5.28243 -4.174,-10.61985 -6.8152,-15.90224 -0.5431,-1.08603 -1.0465,-47.88532 0,-49.97834 3.1978,-6.39565 5.7333,-13.73844 9.0869,-20.44569 1.0997,-2.19934 -0.1153,-4.31282 2.2718,-9.08697 3.1673,-6.33456 -3.6974,-32.65051 2.2717,-38.61962 0.5355,-0.53546 1.7363,0.53545 2.2718,0 1.0709,-1.07091 -1.0709,-3.47258 0,-4.54349 0.5354,-0.53545 1.5944,0.33866 2.2717,0 3.6383,-1.81912 5.6739,-6.81161 9.087,-9.08697 3.0829,-2.0553 6.2993,-3.14968 9.0869,-4.54348 1.9157,-0.95785 2.6278,-3.58564 4.5435,-4.54349 2.9476,-1.4738 6.018,-3.00898 9.087,-4.54348 1.3546,-0.67731 3.4726,1.07091 4.5435,0 0.5354,-0.53546 -0.5355,-1.73629 0,-2.27175 1.3167,-1.31669 7.7703,-3.22678 9.087,-4.54348 4.7003,-4.70032 -7.1827,0.18374 2.2717,-4.54349 2.7067,-1.35336 9.3072,-2.49197 11.3587,-4.54348 0.5355,-0.53546 -0.5354,-1.73629 0,-2.27174 1.0709,-1.07091 3.4726,1.07091 4.5435,0 1.3957,-1.3957 1.5008,-5.2939 4.5435,-6.81523 9.7715,-4.88576 14.0995,-6.81523 27.2609,-6.81523 7.4436,0 14.2824,0.80991 20.4457,-2.27174 3.6416,-1.82082 36.4239,0 43.1631,0 5.0675,0 10.4979,6.34492 15.9022,4.54348 2.5902,-